function loadUpdateLog(){return requestSpreadsheetData("Logs","Update Log").then(e=>{console.log("UpdateValues: ",e);const t=document.getElementById("update-table-body");let n="";const o=getColumnHeaders(e);for(let t=e.length-1;t>=1;t--){const d=e[t],a=d[o.Time],l=new Date(a).getTime(),r=d[o.Browser];let s;s="TRUE"==d[o["Login Status"]].toUpperCase()?"Logged In":"Not Logged In";const g=d[o.Message];n+=`\n        <tr>\n          <td data-sort="${l}">${a}</td>\n          <td>${r}</td>\n          <td>${s}</td>\n          <td>${g}</td>\n        </tr>\n        `}t.innerHTML=n,$("#update-table").DataTable({order:[[0,"desc"]],pageLength:25}),document.getElementById("table-loading").style.display="none"}).catch(e=>{const t="Unable to display error log: ";console.error(t,e),recordError(e,t)})}function loadSignedIn(){const e=document.getElementById("table-loading");e.style.display="",loadUpdateLog()}